楠わ細\n\n### **1. 鍦?**Unix/Linux/macOS** 缁堢涓?*\n\n#### **a. 鏌ョ湅褰撳墠鐩綍涓殑鏂囦欢鍜屾枃浠跺す**\n\n鎵撳紑缁堢鍚庯紝杈撳叆浠ヤ笅鍛戒护骞舵寜鍥炶溅锛歕n\n```bash\nls\n```\n\n- **閫夐」璇存槑**锛歕n  - `ls -l`锛氫互璇︾粏鍒楄〃鐨勫舰寮忔樉绀猴紝鍖呮嫭鏉冮檺銆佹墍鏈夎€呫€佸ぇ灏忓拰淇敼鏃ユ湡銆俓n  - `ls -a`锛氭樉绀烘墍鏈夋枃浠讹紝鍖呮嫭闅愯棌鏂囦欢锛堜互`.`寮€澶寸殑鏂囦欢锛夈€俓n  - `ls -lh`锛氫互浜虹被鍙鐨勬牸寮忔樉绀烘枃浠跺ぇ灏忥紙濡侹B, MB锛夈€俓n\n#### **b. 鏌ョ湅褰撳墠鐩綍璺緞**\n\n```bash\npwd\n```\n\n杩欎釜鍛戒护浼氳緭鍑轰綘褰撳墠鎵€鍦ㄧ殑鐩綍鐨勫畬鏁磋矾寰勩€俓n\n#### **c. 璇诲彇鏂囦欢鍐呭**\n\n鍋囪浣犺璇诲彇涓€涓悕涓?`example.txt` 鐨勬枃浠讹紝鍙互浣跨敤浠ヤ笅鍛戒护锛歕n\n```bash\ncat example.txt\n```\n\n- **鍏朵粬璇诲彇鏂囦欢鐨勫懡浠?*锛歕n  - `less example.txt`锛氬垎椤垫樉绀烘枃浠跺唴瀹癸紝閫傚悎鏌ョ湅澶у瀷鏂囦欢銆俓n  - `more example.txt`锛氱被浼间簬 `less`锛屼絾鍔熻兘杈冧负鏈夐檺銆俓n  - `nano example.txt` 鎴?`vim example.txt`锛氬湪鏂囨湰缂栬緫鍣ㄤ腑鎵撳紑鏂囦欢杩涜缂栬緫銆俓n\n### **2. 鍦?**Windows** 鍛戒护鎻愮ず绗︼紙CMD锛変腑**\n\n#### **a. 鏌ョ湅褰撳墠鐩綍涓殑鏂囦欢鍜屾枃浠跺す**\n\n鎵撳紑鍛戒护鎻愮ず绗﹀悗锛岃緭鍏ヤ互涓嬪懡浠ゅ苟鎸夊洖杞︼細\n\n```cmd\ndir\n```\n\n- **閫夐」璇存槑**锛歕n  - `dir /w`锛氫互瀹芥牸寮忔樉绀烘枃浠跺垪琛ㄣ€俓n  - `dir /p`锛氬垎椤垫樉绀烘枃浠跺垪琛紝閫傚悎鏌ョ湅鍖呭惈澶ч噺鏂囦欢鐨勭洰褰曘€俓n\n#### **b. 鏌ョ湅褰撳墠鐩綍璺緞**\n\n```cmd\ncd\n```\n\n鎴栬€匼n\n```cmd\nchdir\n```\n\n杩欎袱涓懡浠ら兘浼氳緭鍑轰綘褰撳墠鎵€鍦ㄧ殑鐩綍璺緞銆俓n\n#### **c. 璇诲彇鏂囦欢鍐呭**\n\n鍦–MD涓紝榛樿鎯呭喌涓嬫病鏈夊唴缃殑鍛戒护鏉ョ洿鎺ユ煡鐪嬫枃鏈枃浠跺唴瀹癸紝浣嗕綘鍙互浣跨敤浠ヤ笅鏂规硶锛歕n\n- **浣跨敤 `type` 鍛戒护**锛堥€傜敤浜庡皬鍨嬫枃浠讹級锛歕n\n  ```cmd\n  type example.txt\n  ```\n\n  **娉ㄦ剰**锛歚type` 鍛戒护浼氬皢鏁翠釜鏂囦欢鍐呭杈撳嚭鍒扮粓绔紝瀵逛簬澶у瀷鏂囦欢鍙兘涓嶅お瀹炵敤銆俓n\n- **浣跨敤鏂囨湰缂栬緫鍣?*锛歕n\n  浣犲彲浠ヤ娇鐢ㄨ浜嬫湰锛圢otepad锛夋潵鎵撳紑骞舵煡鐪嬫枃浠讹細\n\n  ```cmd\n  notepad example.txt\n  ```\n\n### **3. 鍦?**PowerShell** 涓?*\n\n#### **a. 鏌ョ湅褰撳墠鐩綍涓殑鏂囦欢鍜屾枃浠跺す**\n\n```powershell\nGet-ChildItem\n```\n\n鎴栬€呯畝鍐欎负锛歕n\n```powershell\ngci\n```\n\n- **閫夐」璇存槑**锛歕n  - `Get-ChildItem -Recurse`锛氶€掑綊鏄剧ず鎵€鏈夊瓙鐩綍涓殑鏂囦欢銆俓n  - `Get-ChildItem -File`锛氫粎鏄剧ず鏂囦欢锛屼笉鍖呮嫭鏂囦欢澶广€俓n\n#### **b. 鏌ョ湅褰撳墠鐩綍璺緞**\n\n```powershell\nGet-Location\n```\n\n鎴栬€呯畝鍐欎负锛歕n\n```powershell\npwd\n```\n\n#### **c. 璇诲彇鏂囦欢鍐呭**\n\n```powershell\nGet-Content -Path example.txt\n```\n\n鎴栬€呯畝鍐欎负锛歕n\n```powershell\ngc example.txt\n```\n\n### **4. 浣跨敤 **Python** 鑴氭湰**\n\n濡傛灉浣犳洿鍠滄閫氳繃缂栫▼鏂瑰紡鏉ユ煡鐪嬬洰褰曞拰鏂囦欢鍐呭锛屽彲浠ヤ娇鐢≒ython銆備互涓嬫槸涓€涓畝鍗曠殑绀轰緥锛歕n\n```python\nimport os\n\n