TA_GROUP\n      namespace: zma-dev\n      cluster: default\n      username: nacod\n      password: nacos\n      context-path:\n      ##if use MSE Nacos with auth, mutex with username/password attribute\n      #access-key:\n  store:\n    # support: file 銆?db 銆?redis 銆?raft\n    mode: file\n  #  server:\n  #    service-port: 8091 #If not configured, the default is \'${server.port} + 1000\'\n  security:\n    secretKey: SeataSecretKey0c382ef121d778043159209298fd40bf3850a017\n    tokenValidityInMilliseconds: 1800000\n    ignore:\n      urls: /,/**/*.css,/**/*.js,/**/*.html,/**/*.map,/**/*.svg,/**/*.png,/**/*.jpeg,/**/*.ico,/api/v1/auth/login,/metadata/v1/**\nnacos閰嶇疆涓績閲岄潰锛屽缓涓€涓猻eataServer.properties閰嶇疆鏂囦欢锛屽唴瀹瑰涓嬶細\nData ID: seataServer.properties\nGroup: SEATA_GROUP\nservice.enableDegrade=false\nservice.disableGlobalTransaction=false\nservice.vgroupMapping.default-tx-group=default\nservice.vgroupMapping.order-service-group=default\n鍚姩seata-server,\n鍦╯eata\\bin涓嬶紝鍙屽嚮seata-server.bat鏂囦欢鍚姩锛屾煡鐪媙acos涓槸鍚︽湁seata-server鐨勬湇鍔★紝濡傛灉鏈夛紝璇佹槑鍚姩鎴愬姛銆俓n鎴栬€呭幓璁块棶seata鐨勭鐞嗛〉闈㈠湴鍧€锛歨ttp://localhost:7091,濡傛灉鑳芥甯告墦寮€锛岃瘉鏄巗eata宸茬粡鍚姩鎴愬姛銆俓n浜岋紝寰湇鍔′腑閰嶇疆seata\nspringcloud鐨勫井鏈嶅姟涓厤缃畇eata\n鍏堝湪寰湇鍔＄殑pom.xml涓坊鍔犱緷璧朶n <!-- seata -->\n        <dependency>\n            <groupId>cn.iocoder.cloud</groupId>\n            <artifactId>yudao-spring-boot-starter-seata</artifactId>\n            <version>2.3.0-SNAPSHOT</version>\n        </dependency>\n鐒跺悗鍦╯pringboot寰湇鍔＄殑yml涓厤缃細\n# Seata 閰嶇疆椤癸紝瀵瑰簲 SeataProperties 绫籠nseata:\n  application-id: ${spring.application.name} # Seata 搴旂敤缂栧彿锛岄粯璁や负 ${spring.application.name}\n  tx-service-group: default-tx-group # Seata 浜嬪姟缁勭紪鍙凤紝鐢ㄤ簬 TC 闆嗙兢鍚峔n  # Seata 鏈嶅姟閰嶇疆椤癸紝瀵瑰簲 ServiceProperties 绫籠n  service:\n    vgroup-mapping:\n      default-tx-group: default\n  data-source-proxy-mode: AT\n  # Seata 娉ㄥ唽涓績閰嶇疆椤癸紝瀵瑰簲 RegistryProperties 绫籠n  registry:\n    type: nacos # 娉ㄥ唽涓績绫诲瀷锛岄粯璁や负 file\n    nacos:\n      cluster: default # 浣跨敤鐨?Seata 鍒嗙粍\n      namespace: zma-dev # Nacos 鍛藉悕绌洪棿\