.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog3.png)](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-commitlog3.png)\n\n---\n\n# RocketMQ 瀛樺偍锛坈onsumequeue锛塡n\n## 4. 瀛樺偍锛坈onsumequeue锛塡n\n鐢ㄩ€旓細姣忎釜 topic 鐨?queue锛屽 commitlog 鐨勭储寮昞n\n棰濆浣滅敤锛氳绠楁瘡涓?topic + queue 鐨?offset\n\n![鍏崇郴](http://assets.processon.com/chart_image/60f3fbdf5653bb0b488a1a07.png)\n\n---\n\n## 4.1 鍒嗗竷\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue.png)\n\n鍜?commitlog 涓€鏍风殑鍛藉悕鏂瑰紡锛屽彧鏄ぇ灏忎负 30w * 20B\n\n---\n\n## 4.2 鍐呭\n\n![](https://static.iocoder.cn/rocketmq%E5%AD%98%E5%82%A8-consuequeue2.png)\n\n闀垮害涓?20B\n\n鎻愰棶锛氫负浠€涔堜細鏈?Tag锛焅n\n---\n\n# PMQ 瀛樺偍\n\n## 4.1 琛ㄥ叧绯籠n\n[浼犻€侀棬](https://www.processon.com/diagraming/60f2b4f25653bb0b488947a4)\n\n<!-- 鍙 http://assets.processon.com/chart_image/60f2b4f35653bb0b488947a7.png -->\n\n---\n\n# 4.2 鍒嗗簱鍒嗚〃\n\n![鍒嗗簱鍒嗚〃](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A8.png)\n\n---\n\n# 4.2 鍒嗗簱鍒嗚〃\n\n![鏌ヨ婕旂ず](https://static.iocoder.cn/pmq%E5%AD%98%E5%82%A8-%E5%88%86%E5%BA%93%E5%88%86%E8%A1%A82.png)\n\n----\n\n# 4.3 RocketMQ 鏂囦欢 vs PMQ 琛╘n\n| 瀹氫箟 |  RocketMQ 鏂囦欢 | PMQ 琛?| 澶囨敞 |\n|  ----  |  ----  | ----  | ----  |\n| 涓婚 | `topics.json`  | `topic`  |   |\n| 闃熷垪 |   | `queue` | 鈶?鍒嗗簱鍒嗚〃 |\n| 娑堣垂鑰呭垎缁?| `subscriptionGroupTable.json`  | `consumer_group` |  |\n| 娑堣垂杩涘害 | `offsetTable.json`  | `queue_offset` |  |\n| 娑堣垂鑰?| 鍐呭瓨  | `consumer` | 鈶?鍏变韩 |\n| 鍒嗙粍鐨勬秷璐硅€?| 鍐呭瓨  | `consumer_group_consumer` | 鈶?鍏变韩 |\n| 鍒嗙粍鐨勪富棰?| 鍐呭瓨  | `consumer_group_topic` | 鈶?鍏变韩 |\n| 娑堟伅 | `commitlog` + `consumequeue`  | `message` | 鈶?锛燂紵锛? |\n\n---\n\n# 4.4 鏄惁鍙互姣忎釜闃熷垪鐨勬枃浠讹紝鐩存帴瀛樺偍娑堟伅锛焅n\nkafka 鐨勮璁″姝ゃ€俓n\nrocketmq 浼樼偣锛歕n* commitlog 娑堟伅鐨勫悎骞舵彁浜n* 鏃犳硶鏀拺娴烽噺 Topic + 闃熷垪 [銆婂浣曡В鍐砶afka topic鏁伴噺杩囧甯︽潵鐨勬€ц兘闂锛熴€媇(https://www.zhihu.com/question/431131178/answer/1586855731)\n\nrocketmq 缂虹偣锛歕n* commitlog 鏄『搴忓啓锛屼絾鏄?commitlog 鏄殢鏈鸿\n* 璇诲彇涓ゆ锛屽厛璇?consumequeue锛屽湪璇?commitlog\n\n<!-- 鍙傝€冩枃绔狅紝RocketMQ 璐熻矗浜虹殑鍒嗘瀽 https://developer.aliyun.com/article/105 -->\n\n鎺ㄨ崘闃呰锛歔銆婂ぉ姹犱腑闂翠欢澶ц禌鐧句竾闃熷垪瀛樺偍璁捐鎬荤粨銆愬璧涖€戙€媇(https://mp.weixin.qq.com/s/aQtaDdnGxoGLvmXf7iuhLQ)\n\n---\n\n# RocketMQ 娑堟伅鐨勫啓鍏n\n闇€瑕佸啓鍏?commitlog 鍜?consumequeue\n\n---\n\n## 4.1 鍐欏叆 commitlog\n\n涓夌锛歕n* 鍚屾鍐欏叆\n* 寮傛鍐欏叆 + mmap\n* 寮傛鍐欏叆 + filechannel + buffer\n\n[浼犻€侀棬](https://www.processon.com/diagraming/60eced2d7d9c08312720a8e3)\n\n<!-- 鍙 hhttps://www.processon.com/view/link/60f3becb1efad41bbea96c7d -->\n\nTODO 闇€瑕佸啀鎬濊€冧笅\n\n---\n\n## 4.2 鍐欏叆 consumequeue\n\n![鍐欏叆 consumequeue](http://assets.processon.com/chart_image/60f4590ae401fd4fe054d374.png)\n\n---\n\n# RocketMQ 娑堟伅鐨勮鍙朶n\n涓ょ锛歕n* 鍫嗗唴浼犺緭\n* 鍫嗗浼犺緭 + 闆舵嫹璐漒n\n[浼犻€侀棬](https://www.processon.com/diagraming/60f45b0d637689739c3c2faa)\n\n<!-- 鍙 https://www.processon.com/view/link/60f4619b1e085376da5bbd73 -->\n\nTODO 闇€瑕佸啀鎬濊€冧笅\n\n---\n\n# PMQ 娑堟伅鐨勫啓鍏n\nTopic銆丵ueue 绛夊厓鏁版嵁锛岀紦瀛樺湪鍐呭瓨涓紝閫氳繃瀹氭椂浠诲姟姣?3000 姣鍒锋柊涓€娆°€俓n\n```Java\n    // 璁剧疆浣跨敤鐨?DB 缂栧彿锛涜鍙橀噺锛屾槸 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n濡備笅锛屾槸鎵归噺鎻掑叆娑堟伅鐨?SQL锛歕n\n```SQL\n	<insert id=\"insertBatchDy\" useGeneratedKeys=\"false\">\n		insert into ${tbName} (\n		    biz_id, tag,  head,  body, send_ip, race_id, retry_count\n		)\n		values\n		<foreach collection=\"entityList\" item=\"item\" index=\"index\" separator=\",\">\n		(\n		    #{item.bizId}, #{item.tag}, #{item.body}, #{item.sendIp}, #{item.traceId} , #{item.retryCount}\n		)\n		</foreach>\n	</insert>\n```\n\n[銆婇樋閲屼簯 MySQL 8.0娴嬭瘯缁撴灉銆媇(https://help.aliyun.com/document_detail/150351.html)\n\n[MySQL 鍐欏叆杩囩▼](https://www.processon.com/view/link/5f6eb0845653bb6013249557)\n\n---\n\n# PMQ 娑堟伅鐨勮鍙朶n\n```Java\n    // 璁剧疆浣跨敤鐨?DB 缂栧彿锛涜鍙橀噺锛屾槸 ThreadLocal\n    message01Service.setDbId(temp.getDbNodeId());\n```\n\n濡備笅锛屾槸鎵归噺鏌ヨ娑堟伅鐨?SQL锛歕n\n```SQL\n	<select id=\"getListDy\" resultMap=\"BaseResultMap\" statementType=\"STATEMENT\"\n		useCache=\"false\">\n	        <![CDATA[\n			select *\n			from ${tbName} where id>${start} and id<=${end}\n	         ]]>\n	</select>\n```\n\n---\n\n# RocketMQ 楂樺彲鐢╘n\n* 涓讳粠鏋舵瀯\n* [鍩轰簬 Raft 鍗忚鐨勫鍓湰鏋舵瀯](https://www.infoq.cn/article/7xejrpdzba9v*gdzofs6)\n\n---\n\n# 1. RocketMQ 楂樺彲鐢紙涓讳粠鏋舵瀯锛塡n\n![](http://assets.processon.com/chart_image/60f434325653bb0b488a54c1.png)\n\n* 涓讳粠涓嶆敮鎸佸垏鎹n* 澶氬 Broker 闆嗙兢淇濊瘉鍙敤鎬n* 闇€瑕佸悓姝ョ殑鏁版嵁锛?锛塩ommitlog锛?锛塩onfig\n\n---\n\n# 2. RocketMQ 楂樺彲鐢紙涓讳粠鍚屾 commitlog锛塡n\n鍚屾绫诲瀷锛歕n* 鍚屾\n* 寮傛\n\n[娴佺▼鍥綸(https://www.processon.com/diagraming/60f43bbee401fd4fe054bb9a)\n\n<!-- 鍙 <https://www.processon.com/view/link/60f440b7637689739c3c1b3a> -->\n\n---\n\n# 3. RocketMQ 楂樺彲鐢紙涓讳粠鍚屾 config锛塡n\n[娴佺▼鍥綸(https://www.processon.com/diagraming/60f445d10791291daf48df0e)\n\n<!-- 鍙 <https://www.processon.com/view/link/60f4476c7d9c087bac5ce124> -->\n\n---\n\n# PMQ 楂樺彲鐢╘n\n[浼犻€侀棬](https://www.processon.com/diagraming/60f447f55653bb0b488a6a94)\n\n<!-- 鍙 <https://www.processon.com/view/link/60f4488a1e085376da5bae6b> -->\n\n* Broker 鏃犵姸鎬侊紝闆嗙兢\n* MySQL 涓讳粠闆嗙兢\n\n---\n\n# RocketMQ 寤惰繜娑堟伅锛堝畾涔夛級\n\n寤惰繜绾у埆锛歕n\n| 寤惰繜绾у埆 | 鏃堕棿 |    寤惰繜绾у埆  |   鏃堕棿   |\n| :------- | :--- | ---- | :--- |\n| 1        | 1s   | 10   | 6m   |\n| 2        | 5s   | 11   | 7m   |\n| 3        | 10s  | 12   | 8m   |\n| 4        | 30s  | 13   | 9m   |\n| 5        | 1m   | 14   | 10m  |\n| 6        | 2m   | 15   | 20m  |\n| 7        | 3m   | 16   | 30m  |\n| 8        | 4m   | 17   | 1h   |\n| 9        | 5m   | 18   | 2h   |\n\n---\n\n# RocketMQ 寤惰繜娑堟伅锛堝疄鐜帮級\n\n瀹炵幇鍘熺悊锛歔浼犻€侀棬](https://www.processon.com/diagraming/60f468067d9c087bac5cf13a)\n\n<!-- 鍙 https://www.processon.com/view/link/60f46df31efad41bbeaa2182 -->\n\n# 鍏跺畠涓棿浠剁殑寤惰繜娑堟伅\n\n* Mafka 鏀寔浠绘剰缁村害鐨勫欢杩熸秷鎭痋n* [QMQ 鏀寔浠绘剰鏃堕棿鐨勫欢杩熸秷鎭痌(https://github.com/qunarcorp/qmq/blob/master/docs/cn/arch.md#%E5%BB%B6%E6%97%B6%E5%AE%9A%E6%97%B6%E6%B6%88%E6%81%AF)\n* [rabbitmq 鏀寔浠诲姟鏃堕棿鐨勫欢杩熸秷鎭痌(https://blog.csdn.net/u013256816/article/details/55106401)\n* [婊存淮寮€婧愬垎甯冨紡娑堟伅涓棿浠朵骇鍝?DDMQ](https://blog.didiyun.com/index.php/2019/01/18/ddmq/)\n\n---\n\n# MQ 浜嬪姟娑堟伅\n\n* [涓轰粈涔堜細鏈変簨鍔＄殑闂锛焆(https://www.processon.com/diagraming