CREATE TABLE `system_menu` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '鑿滃崟ID',
  `name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '鑿滃崟鍚嶇О',
  `permission` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '鏉冮檺鏍囪瘑',
  `type` tinyint NOT NULL COMMENT '鑿滃崟绫诲瀷',
  `sort` int NOT NULL DEFAULT '0' COMMENT '鏄剧ず椤哄簭',
  `parent_id` bigint NOT NULL DEFAULT '0' COMMENT '鐖惰彍鍗旾D',
  `path` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT '' COMMENT '璺敱鍦板潃',
  `icon` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT '#' COMMENT '鑿滃崟鍥炬爣',
  `component` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '缁勪欢璺緞',
  `component_name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '缁勪欢鍚?,
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '鑿滃崟鐘舵€?,
  `visible` bit(1) NOT NULL DEFAULT b'1' COMMENT '鏄惁鍙',
  `keep_alive` bit(1) NOT NULL DEFAULT b'1' COMMENT '鏄惁缂撳瓨',
  `always_show` bit(1) NOT NULL DEFAULT b'1' COMMENT '鏄惁鎬绘槸鏄剧ず',
  `creator` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT '' COMMENT '鍒涘缓鑰?,
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '鍒涘缓鏃堕棿',
  `updater` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT '' COMMENT '鏇存柊鑰?,
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '鏇存柊鏃堕棿',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '鏄惁鍒犻櫎',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5214 DEFAULT CHARSET=utf8mb3 COMMENT='鑿滃崟鏉冮檺琛?;
